import React, { Component } from 'react';
// import React, { useState } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import logo from './usd_flightsearch.jpeg'; 
import TextField from '@material-ui/core/TextField';

console.log(logo);

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "url(" + { logo } + ")"
};

function App() {

  return (
    <section style={sectionStyle}>
    <div className="App">
      <header className="App-header">
          <h1>
            Expert Flight Search
          </h1>

          <div className="logo">
          {/* <img src={logo} alt="logo" /> */}
        </div>
      </header>


      <form>

        <div>

        <input type="radio" value="oneway" name="genbookingtypeder" /> One way
        <input type="radio" value="round" name="bookingtype" /> Round Trip

        </div>

        <label>
          <input type="text" placeholder="Leaving from" name="source" /> <br/><br/>
        </label>

        <label>
          {/* Going to: */}
          <input type="text" placeholder="Going to" name="destination" /> <br /><br/>
        </label>

        <input type="submit" value="Search" />

    </form>


    </div>
    </section>
  );
}

 export default App;

